import React from "react";
const Slotm = props => {
  // let x = "‚ù§";
  // let y = "‚ù§";
  // let z = "üëç";

  let x = props.x;
  let y = props.y;
  let z = props.z;
  if (x === y && y === z) {
    return (
      <>
        <div>
          <h1>
            {x}
            {y}
            {z}
          </h1>
          <h1>this is Matching</h1>
          <hr />
        </div>
      </>
    );
  } else {
    return (
      <>
        <div>
          <h1>
            {x}
            {y}
            {z}
          </h1>
          <h1>this is Not Matching</h1>
          <hr />
        </div>
      </>
    );
  }
};
export default Slotm;
